// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Transaction {
    // Events
    event TransactionExecuted(
        address indexed from,
        address indexed to,
        uint256 amount,
        uint256 timestamp
    );
    
    event TransactionFailed(
        address indexed from,
        address indexed to,
        uint256 amount,
        string reason
    );

    // Struct to store transaction details
    struct TransactionDetails {
        address from;
        address to;
        uint256 amount;
        uint256 timestamp;
        bool completed;
    }

    // Array to store all transactions
    TransactionDetails[] public transactions;
    
    // Mapping to track user balances
    mapping(address => uint256) public balances;

    // Function to send ETH to another address
    function sendTransaction(address payable _to) public payable {
        require(_to != address(0), "Invalid recipient address");
        require(msg.value > 0, "Amount must be greater than 0");
        require(_to != msg.sender, "Cannot send to yourself");

        // Transfer the amount
        (bool sent, ) = _to.call{value: msg.value}("");
        
        if (sent) {
            // Store transaction details
            transactions.push(TransactionDetails({
                from: msg.sender,
                to: _to,
                amount: msg.value,
                timestamp: block.timestamp,
                completed: true
            }));

            // Update balances
            balances[msg.sender] += msg.value;

            // Emit success event
            emit TransactionExecuted(
                msg.sender,
                _to,
                msg.value,
                block.timestamp
            );
        } else {
            // Emit failure event and revert
            emit TransactionFailed(
                msg.sender,
                _to,
                msg.value,
                "Transaction failed"
            );
            revert("Failed to send ETH");
        }
    }

    // Function to get all transactions for an address
    function getTransactions() public view returns (TransactionDetails[] memory) {
        return transactions;
    }

    // Function to get user's transaction count
    function getTransactionCount() public view returns (uint256) {
        return transactions.length;
    }

    // Function to get contract balance
    function getContractBalance() public view returns (uint256) {
        return address(this).balance;
    }

    // Function to receive ETH
    receive() external payable {
        balances[msg.sender] += msg.value;
    }

    // Function to check if an address exists
    function isValidAddress(address _address) public pure returns (bool) {
        return _address != address(0);
    }
}
